CREATE TABLE statements, unsurprisingly, create new tables in the current database. For example, the following command creates a table called "accounts". Each account has a corresponding name, email, balance, and an age. Each column in this table has an associated type: name and email are strings (TEXT), balance is a float (REAL), and age is an integer (INTEGER). CREATE TABLE accounts ( name TEXT, email TEXT, balance REAL, age INTEGER
); Sometimes, you'll want to create a table only if it doesn't already exists. You can use CREATE TABLE IF NOT EXISTS for that: CREATE TABLE IF NOT EXISTS accounts ( name TEXT, email TEXT, balance REAL, age INTEGER
); Either way we do it, we've now create an empty accounts table in the database. accounts name email balance age
